INSERT INTO `Articles` VALUES (4,'Article','Authe','2021-07-02 03:30:00','article-images/9a788a67-69e3-47e5-b194-f613cdd96159.jpg','Lorem Ipsum is simply dummy text of the printing and typesetting industry.','<p style=\"text-align: left;\"><strong>Lorem Ipsum</strong>&nbsp;is simply dummy text of the printing and typesetting industry.</p>','2021-07-20 08:27:50','2021-07-23 12:58:55'),(10,'TestArticle001','TestAuthor001','2021-07-23 12:30:24','article-images/17e569ff-6659-48c1-b982-b0f409b9f428.jpg','It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using \'Content here, content here\', making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for \'lorem ipsum\' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).','<p>It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using \'Content here, content here\', making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for \'lorem ipsum\' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).</p>','2021-07-23 13:01:07','2021-07-23 13:12:39'),(11,'Artist111','author','2021-07-23 11:23:08','article-images/e73ae58b-b939-4a0c-a561-fb6e3b43d29f.jpg','short','<p>short</p>','2021-07-23 13:23:46','2021-07-23 14:16:20'),(13,'Art Fight','Adam','2021-07-27 03:13:52','article-images/af671bec-ed0f-4c6a-912e-f075f703a187.jpg','This stuff is the blackest black. It is so black that it makes reality look Photoshopped. Perception of depth and dimensionality disappears into a scotoma of darkness. You look at Vantablack, but nothing looks back at you.','<div>\n<h2>What is Lorem Ipsum?</h2>\n<p><strong>Lorem Ipsum</strong>&nbsp;is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>\n</div>\n<div>\n<h2>Why do we use it?</h2>\n<p>It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using \'Content here, content here\', making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for \'lorem ipsum\' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).</p>\n<h2>Where does it come from?</h2>\n<p>Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 of \"de Finibus Bonorum et Malorum\" (The Extremes of Good and Evil) by Cicero, written in 45 BC. This book is a treatise on the theory of ethics, very popular during the Renaissance. The first line of Lorem Ipsum, \"Lorem ipsum dolor sit amet..\", comes from a line in section 1.10.32.</p>\n<h2>Where can I get some?</h2>\n<p>There are many variations of passages of Lorem Ipsum available, but the majority have suffered alteration in some form, by injected humour, or randomised words which don\'t look even slightly believable. If you are going to use a passage of Lorem Ipsum, you need to be sure there isn\'t anything embarrassing hidden in the middle of text. All the Lorem Ipsum generators on the Internet tend to repeat predefined chunks as necessary, making this the first true generator on the Internet. It uses a dictionary of over 200 Latin words, combined with a handful of model sentence structures, to generate Lorem Ipsum which looks reasonable. The generated Lorem Ipsum is therefore always free from repetition, injected humour, or non-characteristic words etc.</p>\n<p>The standard chunk of Lorem Ipsum used since the 1500s is reproduced below for those interested. Sections 1.10.32 and 1.10.33 from \"de Finibus Bonorum et Malorum\" by Cicero are also reproduced in their exact original form, accompanied by English versions from the 1914 translation by H. Rackham.</p>\n</div>','2021-07-27 09:46:36','2021-07-27 09:46:36'),(14,'The Art of Fantasy Illustration','Here Be Dragons','2021-07-01 05:30:00','article-images/59593311-5d36-49cc-a6ad-94ff404b6016.jpg','A knight in shining armor wields his sword against a horned dragon about to roast its prey. Its a timeless image, rendered in stories and artwork for a thousand years, but reimagined by top fantasy artist Donato Giancola in his St. George and the Dragon, a classical-style painting from 2010 that heralds Enchanted: A History of Fantasy Illustration a new exhibition at the Norman Rockwell Museum (NRM) in Stockbridge, Massachusetts, through October 31.','<p>A knight in shining armor wields his sword against a horned dragon about to roast its prey. It&rsquo;s a timeless image, rendered in stories and artwork for a thousand years, but reimagined by top&nbsp;<a href=\"https://www.artandobject.com/articles/persian-fantasy-hudson\">fantasy</a>&nbsp;artist Donato Giancola in his&nbsp;<em>St. George and the Dragon</em>, a classical-style painting from 2010 that heralds&nbsp;<a href=\"https://www.nrm.org/2021/05/enchanted-a-history-of-fantasy-illustration/\" target=\"_blank\" rel=\"noopener nofollow\"><em><u>Enchanted</u></em></a><em><u><a href=\"https://www.nrm.org/2021/05/enchanted-a-history-of-fantasy-illustration/\" target=\"_blank\" rel=\"noopener nofollow\">:</a></u></em><a href=\"https://www.nrm.org/2021/05/enchanted-a-history-of-fantasy-illustration/\" target=\"_blank\" rel=\"noopener nofollow\">&nbsp;<em><u>A History of Fantasy Illustration</u></em></a>&nbsp;a new exhibition at the Norman Rockwell Museum (NRM) in Stockbridge, Massachusetts, through October 31.</p>\n<p>&ldquo;I thought that this really set up the exhibit quite well because it&rsquo;s got the archetypal images here of the knight and the dragon and the historical reference between then and now,&rdquo; said curator Jesse Kowalski during a recent tour through the long-awaited exhibition.</p>\n<p>Dragons are everywhere, perhaps none so famous as the one depicted in the 1977 painting used on the cover of the very first&nbsp;<em>Dungeons &amp; Dragons&nbsp;</em>game. It&rsquo;s the piece Kowalski said he is most excited to have in the show, as this is the first time the painting is on view to the public.</p>\n<p>And&nbsp;<em>Here There Be Dragons</em>, a 2018 work on paper made by Hugo Award winner Charles Vess for the cover of the fiftieth-anniversary edition of Ursula K. Le Guin&rsquo;s&nbsp;<em>The Books of Earthsea: The Complete Illustrated Edition</em>, is particularly noteworthy because Vess illustrated Le Guin&rsquo;s characters the way she desired&mdash;as people of color. &ldquo;Before she died, she finally got to see them the way she wanted them,&rdquo; Kowalski said.</p>','2021-07-28 05:44:14','2021-07-28 05:44:47'),(15,'Meet the New Surrealists Redefining Psychedelia','Magical Mexico','2021-07-28 11:24:31','article-images/eba6f3c3-9288-44d9-8245-6fb253565bf8.png','When a group of European Surrealists immigrated to Mexico in the late 1930s to escape World War II, they found a culture in which their art would flourish. French poet and critic Andre Breton drafted the Manifesto of Surrealism in 1924. After visiting Mexico in 1938, he called it the most surreal country in the world. Salvador Dal declared, There is no way Im going back to Mexico. I cant stand to be in a country that is more Surrealist than my paintings. Though Breton included Mexicos own Frida Kahlo and her husband Diego Rivera in the fourth International Surrealist Exhibition of 1940\'s Mexico City, Kahlo never embraced the movement.','<p>When a group of European Surrealists immigrated to Mexico in the late 1930s to escape World War II, they found a culture in which their art would flourish. French poet and critic Andre Breton drafted the&nbsp;<em>Manifesto of Surrealism</em>&nbsp;in 1924. After visiting Mexico in 1938, he called it the most surreal country in the world.&nbsp;<a href=\"https://www.artandobject.com/news/8-bizarre-facts-about-salvador-dali\">Salvador Dal&iacute;</a>&nbsp;declared, &ldquo;There is no way I&rsquo;m going back to Mexico. I can&rsquo;t stand to be in a country that is more Surrealist than my paintings.&rdquo; Though Breton included Mexico&rsquo;s own&nbsp;<a href=\"https://www.artandobject.com/articles/how-frida-kahlos-sense-self-created-icon\">Frida Kahlo</a>&nbsp;and her husband Diego Rivera in the fourth International Surrealist Exhibition of 1940\'s&nbsp;Mexico City, Kahlo never embraced the movement.</p>\n<p>Among those immigrants to Mexico were three artists eventually nicknamed \"The Three Witches.\" They were Leonora Carrington of England, Remedios Varo from Spain, and Hungarian-born photographer Kati Horna. While Carrington and Varo both rejected the Surrealist label, they shared an interest in mysticism and magic, amply provided by Mexican culture.</p>\n<p>Liminal spaces and practices still exist. Using techniques including herbalism, divination, and spiritual cleansing, traditional&nbsp;<em>curanderismo</em>&nbsp;healers treat ailments including soul loss and the evil eye. A&nbsp;<em>brujo</em>&nbsp;can inflict a curse, while shape-shifting sorcerers called&nbsp;<em>nahualli</em>&nbsp;take animal forms.</p>','2021-07-28 12:26:39','2021-07-29 07:49:53'),(16,'Article Lorem','Lorem Ipsum','2021-07-29 12:46:44','article-images/f71cdf6e-34c5-4e9e-9475-636d4b30c9ba.jpg','Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book.','<p style=\"text-align: center;\"><img src=\"https://gae.s3.amazonaws.com/article-content/226e4bc1-3127-40ad-be16-1d25c672aca7.fif\" alt=\"\" width=\"500\" height=\"400\" /></p>\n<div>\n<h2><span style=\"font-family: \'comic sans ms\', sans-serif;\">What is Lorem Ipsum?</span></h2>\n<p><strong>Lorem Ipsum</strong>&nbsp;is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>\n</div>\n<div>\n<h2 style=\"text-align: justify;\"><span style=\"font-family: \'comic sans ms\', sans-serif;\">Why do we use it?</span></h2>\n<p>It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using \'Content here, content here\', making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for \'lorem ipsum\' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).</p>\n</div>\n<p>&nbsp;</p>\n<div>\n<h2>Where does it come from?</h2>\n<p>Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 of \"de Finibus Bonorum et Malorum\" (The Extremes of Good and Evil) by Cicero, written in 45 BC. This book is a treatise on the theory of ethics, very popular during the Renaissance. The first line of Lorem Ipsum, \"Lorem ipsum dolor sit amet..\", comes from a line in section 1.10.32.</p>\n<p>The standard chunk of Lorem Ipsum used since the 1500s is reproduced below for those interested. Sections 1.10.32 and 1.10.33 from \"de Finibus Bonorum et Malorum\" by Cicero are also reproduced in their exact original form, accompanied by English versions from the 1914 translation by H. Rackham.</p>\n<p>&nbsp;</p>\n<h2 style=\"text-align: left;\">Where can I get some?</h2>\n<p>There are many variations of passages of Lorem Ipsum available, but the majority have suffered alteration in some form, by injected humour, or randomised words which don\'t look even slightly believable. If you are going to use a passage of Lorem Ipsum, you need to be sure there isn\'t anything embarrassing hidden in the middle of text. All the Lorem Ipsum generators on the Internet tend to repeat predefined chunks as necessary, making this the first true generator on the Internet. It uses a dictionary of over 200 Latin words, combined with a handful of model sentence structures, to generate Lorem Ipsum which looks reasonable. The generated Lorem Ipsum is therefore always free from repetition, injected humour, or non-characteristic words etc.</p>\n</div>','2021-07-29 08:50:59','2021-07-29 11:04:15'),(17,'Dantes Divine Comedy and Its Influence on Art History','ANGELICA FREY','2021-07-30 03:41:31','article-images/5303357b-577a-4062-a4a7-4649039b03cf.jpg','Ever since Dantes Divine Comedy was published, it both ascended to the canon of Western literature and inspired countless artistic interpretations of the poets journey through the otherworld as he and his guides traverse the depths of Hell, climb Mount Purgatory, and then ascend to Paradise. Artists in all media have responded to the Commedia with an abundance and enthusiasm that even the Bible has not matched, writes Jean-Pierre Barricelli in the paper Dante in the Arts: A Survey published in the 1996 edition of Dante Studies.','<p><img src=\"https://gae.s3.amazonaws.com/article-content/a56d40f6-f8a0-4c76-95d0-aa2b2b479fd0.jpg\" alt=\"\" width=\"503\" height=\"503\" /></p>\n<p>&nbsp;</p>\n<p><strong>Painters have long recognized the importance of understanding the source material intimately: through their execution, they sought to transcribe the poet&rsquo;s vision.</strong></p>\n<p><span style=\"color: #e03e2d;\">&ldquo;Dante&rsquo;s imaginative comparisons and vivid descriptions of the afterlife have sparked the imaginations of innumerable artists,&rdquo; Deborah Parker, Professor of Italian at the University of Virginia, tells&nbsp;<em>Art &amp; Object.</em>&nbsp;&ldquo;Many artists introduce changes, some subtle, others more striking,&rdquo; she continued. Gustave Dor&eacute; and Sandro Botticelli&mdash;she cites as examples&mdash;while generally faithful to Dante&rsquo;s text, also introduced changes to their works. Dor&eacute;, for example, added more women among the damned. &ldquo;Artists don&rsquo;t just depict, they interpret,&rdquo; she said.</span></p>\n<p><strong>Painters have long recognized the importance of understanding the source material intimately</strong></p>\n<p><span style=\"color: #34495e;\">&ldquo;Dante&rsquo;s imaginative comparisons and vivid descriptions of the afterlife have sparked the imaginations of innumerable artists,&rdquo; Deborah Parker, Professor of Italian at the University of Virginia, tells&nbsp;<em>Art &amp; Object.</em>&nbsp;&ldquo;Many artists introduce changes, some subtle, others more striking,&rdquo; she continued. Gustave Dor&eacute; and Sandro Botticelli&mdash;she cites as examples&mdash;while generally faithful to Dante&rsquo;s text, also introduced changes to their works. Dor&eacute;, for example, added more women among the damned. &ldquo;Artists don&rsquo;t just depict, they interpret,&rdquo; she said.</span></p>','2021-07-30 07:44:56','2021-07-30 08:00:22'),(20,'What Do You Call a Person Who Buys Art?','Luz Seile','2021-08-05 13:26:51','article-images/f7fbf7f3-643f-4bee-ad05-06f78dba82fb.jpg','Traditionally, it has been a buyer, a client, an art collector, a curator, an art dealer, a gallery owner, a decorator, an interior designer.','<p id=\"viewer-3qqn6\" class=\"XzvDs _208Ie _1atvN _2QAo- _25MYV _2WrB- _1atvN public-DraftStyleDefault-block-depth0 public-DraftStyleDefault-text-ltr\"><span class=\"vkIF2 public-DraftStyleDefault-ltr\">Traditionally, it has been a buyer, a client, an art collector, a curator, an art dealer, a gallery owner, a decorator, an interior designer.</span></p>\n<p id=\"viewer-fkjl7\" class=\"XzvDs _208Ie _1atvN _2QAo- _25MYV _2WrB- _1atvN public-DraftStyleDefault-block-depth0 public-DraftStyleDefault-text-ltr\"><span class=\"vkIF2 public-DraftStyleDefault-ltr\">At GAX, that person could also be YOU! A mom, a teacher, a driver, a barista, a website developer... YOU, EVERYONE, living anywhere in the world...</span></p>','2021-08-05 13:28:46','2021-08-05 13:28:46'),(21,'The Art Collector of the Past','Luz Suile','2021-08-05 13:36:02','article-images/8f6b85ec-8942-4258-b298-2f2b108ed5c9.jpg','In the past, around the world, the circle of people who could afford to collect fine art was an airtight group of the few.','<p id=\"viewer-3qqn6\" class=\"XzvDs _208Ie _1atvN _2QAo- _25MYV _2WrB- _1atvN public-DraftStyleDefault-block-depth0 public-DraftStyleDefault-text-ltr\"><span class=\"vkIF2 public-DraftStyleDefault-ltr\">In the past, around the world, the circle of people who could afford to collect fine art was an airtight group of the few.</span></p>\n<p id=\"viewer-5357j\" class=\"XzvDs _208Ie _1atvN _2QAo- _25MYV _2WrB- _1atvN public-DraftStyleDefault-block-depth0 public-DraftStyleDefault-text-ltr\"><span class=\"vkIF2 public-DraftStyleDefault-ltr\">It was a small milieu of the rich and elite where they all knew other very well, whether they were collectors, dealers, experts or curators. They built their relationships on a networked secrecy of advantage over others. They still remain this small secret society, but now with GAX, you can break it open and give it light.</span></p>','2021-08-05 13:37:08','2021-08-09 08:44:48');
