INSERT INTO `Artists` VALUES (1,'Casper David','1621849126538-artist-one.jpg',NULL,'1622550991236-photo_2021-06-01_13-38-40.jpg','In 2003, 24 Pollockesque paintings and drawings were found in a locker in Wainscott, New York. In 2005, The Pollock-Krasner Foundation requested a fractal analysis to be used for the first time in an authenticity dispute stirring controversy by researchers at the University of Oregon, which identified differences between the patterns in the six disputed paintings analyzed and those in 14 established Pollocks. Pigment analysis of the paintings by researchers at Harvard University showed the presence in one painting of a synthetic pigment that was not patented until the 1980s, and materials in two others that were not available in Pollock\'s lifetime.','Russian art group that started a global art-activist and their movement. In 2012 two of us, Nadya and Masha, served 2 years in jail for an anti-Putin action.',NULL,NULL,0,'2021-05-05 06:52:55','2021-05-05 06:52:55',NULL),(2,'Artist 2','1621849126538-artist-one.jpg',NULL,'1621849126886-art-two.jpg','In 2003, 24 Pollockesque paintings and drawings were found in a locker in Wainscott, New York. In 2005, The Pollock-Krasner Foundation requested a fractal analysis to be used for the first time in an authenticity dispute stirring controversy by researchers at the University of Oregon, which identified differences between the patterns in the six disputed paintings analyzed and those in 14 established Pollocks. Pigment analysis of the paintings by researchers at Harvard University showed the presence in one painting of a synthetic pigment that was not patented until the 1980s, and materials in two others that were not available in Pollock\'s lifetime.','Russian art group that started a global art-activist and their movement. In 2012 two of us, Nadya and Masha, served 2 years in jail for an anti-Putin action.',NULL,NULL,0,'2021-05-05 06:52:55','2021-05-05 06:52:55',NULL),(3,'Artist 3','1621849126538-