CREATE TABLE `Arts` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) DEFAULT NULL,
  `artist` int(11) DEFAULT NULL,
  `currentPrice` varchar(255) NOT NULL,
  `initialPrice` varchar(255) NOT NULL,
  `forSell` tinyint(1) DEFAULT '1',
  `totalArtAsserts` int(11) DEFAULT NULL,
  `availableArtAsserts` int(11) DEFAULT NULL,
  `category` int(11) DEFAULT NULL,
  `style` int(11) DEFAULT NULL,
  `era` int(11) DEFAULT NULL,
  `highlight` int(11) DEFAULT NULL,
  `color` int(11) DEFAULT NULL,
  `pattern` int(11) DEFAULT NULL,
  `description` longtext,
  `shortDescription` longtext,
  `dossierDescription` longtext,
  `yearRangeStart` varchar(255) DEFAULT NULL,
  `yearRangeEnd` varchar(255) DEFAULT NULL,
  `history` text,
  `size` varchar(255) DEFAULT '',
  `uom` int(11) DEFAULT '1',
  `width` varchar(255) DEFAULT '',
  `height` varchar(255) DEFAULT '',
  `sizeInInch` varchar(255) DEFAULT 'N/A',
  `sizeInCentiMeter` varchar(255) DEFAULT '',
  `totalCommision` int(11) DEFAULT '0',
  `createdAt` datetime NOT NULL,
  `updatedAt` datetime NOT NULL,
  `deletedAt` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `artist` (`artist`),
  KEY `category` (`category`),
  KEY `style` (`style`),
  KEY `era` (`era`),
  KEY `highlight` (`highlight`),
  KEY `color` (`color`),
  KEY `pattern` (`pattern`),
  CONSTRAINT `Arts_ibfk_1` FOREIGN KEY (`artist`) REFERENCES `Artists` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `Arts_ibfk_2` FOREIGN KEY (`category`) REFERENCES `Categories` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `Arts_ibfk_3` FOREIGN KEY (`style`) REFERENCES `ArtStyles` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `Arts_ibfk_4` FOREIGN KEY (`era`) REFERENCES `ArtEras` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `Arts_ibfk_5` FOREIGN KEY (`highlight`) REFERENCES `ArtHighlights` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `Arts_ibfk_6` FOREIGN KEY (`color`) REFERENCES `ArtColors` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `Arts_ibfk_7` FOREIGN KEY (`pattern`) REFERENCES `ArtPatterns` (`id`) ON DELETE SET NULL ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=131 DEFAULT CHARSET=latin1;
